import React from "react";
import { View, Text, ImageBackground, StyleSheet, TouchableOpacity } from "react-native";
import {router} from "expo-router";

interface Category {
    title : string,
    image : string
}

const categories : Category[] = [
  { title: "Clothing", image: ("https://www.shutterstock.com/image-photo/clothes-on-clothing-hanger-260nw-2338282257.jpg") },
  { title: "Footwear", image: ("https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS_r2TH-dNEty38IFbCdfLOUR4oELh5KInCKw&s") },
  { title: "Beauty", image: ("data:image/jpeg;base64,") },
  { title: "Fitness", image: ("data:image/jpeg;base64,") },
  { title: "Technology", image: ("data:image/jpeg;base64,") },
  { title: "Food", image: ("data:image/jpeg;base64,") },
  { title: "Craft", image: ("https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTUw0uFt4dxMU21wn5N1Fpkc083ihYSKZ8mxI-0TkCxDC9PtRqItp2ozUc&s") },
  { title: "Home Decor", image: ("data:image/jpeg;base64,") },
];

const Categorygrid = () => {
    const handlePress = (category: string) => {
    router.push({
        pathname : "/components/afterCategorypage",
        params : {
        type : category
        }
    })
  };

  return (
    <View style={styles.container}>
      {categories.map((category, index) => (
        <TouchableOpacity
          key={index}
          style={styles.item}
          onPress={() => handlePress(category.title)}
        >
          <ImageBackground
            source={{uri: category.image}}
            style={styles.image}
            imageStyle={styles.imageBorder}
          >
            <View style={styles.overlay}>
              <Text style={styles.text}>{category.title}</Text>
            </View>
          </ImageBackground>
        </TouchableOpacity>
      ))}
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flexDirection: "row",
    flexWrap: "wrap",
    justifyContent: "space-between",
    padding: 10,
  },
  item: {
    width: "48%",
    height: 150,
    marginBottom: 10,
    borderRadius: 15,
    overflow: "hidden",
  },
  image: {
    flex: 1,
    justifyContent: "flex-end",
  },
  imageBorder: {
    borderRadius: 15,
  },
  overlay: {
    backgroundColor: "rgba(0, 0, 0, 0.4)",
    padding: 10,
  },
  text: {
    color: "white",
    fontSize: 16,
    fontWeight: "bold",
    textAlign: "center",
  },
});

export default Categorygrid;
